import { Form, Button, Input, Select, DatePicker, InputNumber} from 'antd'
import {FormInstance} from 'antd/es/form'
import React from 'react';

import { useState } from 'react'

export default function Body(){

  const [name,setName]= useState('')
  const [phone, setPhone] = useState('');
  const { Option } = Select;

  function finish(value: any){
    console.log(value)
  }

  const dateFormat = 'DD/MM/YYYY';

  return <>
    <Form onFinish={finish}>
        <Form.Item
            name={['name']}
            label= "Nome completo"
            rules={[{required: true}]}
        >
            <Input placeholder='Nome completo'></Input>
        </Form.Item>

        <Form.Item name="gender" label="Genêro" rules={[{required: true}]}>
            <Select
                placeholder='Selecione seu sexo'             
            >                
                <Option value="male">Masculino</Option>
                <Option value="female">Feminino</Option>
                <Option value="other">Outro</Option>
            </Select>
        </Form.Item>

        <Form.Item
            name={['birth']} 
            label="Data de nascimento"  
            rules={[{required: true}]}   
               
        >
            <DatePicker picker="date" placeholder='Data de nascimento' format={dateFormat}></DatePicker>

        </Form.Item>

        <Form.Item
            name={['email']}
            label="email"
            rules={[
                {required: true},
                {type:'email',
                message:"Este email não é valido"}
            
            ]}
        >   
            <Input></Input>

        </Form.Item>

        <Form.Item
            name={['phone']}
            label="Telefone"
            rules={[{required: true}]}
        >
            <Input type='phone'  
            ></Input>
        </Form.Item>
        <Button type="primary" htmlType="submit">Salvar</Button>

        


    </Form>
  </>

}
